import React, { Component } from "react";
import { render } from 'react-dom';
import {AgGridColumn, AgGridReact} from 'ag-grid-react';
import { useEffect, useState, useRef } from 'react';
import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-alpine.css';

const SearchPage = () => {
    const rowData = [
        {title: "Love Life", author: "Amy Azelia", genre: "Romance"},
        {title: "The Secret Society", author: "Adrien Potter", genre: "Mystery"},
        {title: "Ancient Civilization", author: "Gideon Aberforth", genre: "History"},
        {title: "Elite Guardians", author: "Loki Odinson", genre: "SciFi"},
        {title: "Love Life", author: "Amy Azelia", genre: "Romance"},
        {title: "The Secret Society", author: "Adrien Potter", genre: "Mystery"},
        {title: "Ancient Civilization", author: "Gideon Aberforth", genre: "History"},
        {title: "Elite Guardians", author: "Loki Odinson", genre: "SciFi"},
        {title: "Love Life", author: "Amy Azelia", genre: "Romance"},
        {title: "The Secret Society", author: "Adrien Potter", genre: "Mystery"},
        {title: "Ancient Civilization", author: "Gideon Aberforth", genre: "History"},
        {title: "Elite Guardians", author: "Loki Odinson", genre: "SciFi"},
        {title: "Love Life", author: "Amy Azelia", genre: "Romance"},
        {title: "The Secret Society", author: "Adrien Potter", genre: "Mystery"},
        {title: "Ancient Civilization", author: "Gideon Aberforth", genre: "History"},
        {title: "Elite Guardians", author: "Loki Odinson", genre: "SciFi"},
        {title: "Love Life", author: "Amy Azelia", genre: "Romance"},
        {title: "The Secret Society", author: "Adrien Potter", genre: "Mystery"},
        {title: "Ancient Civilization", author: "Gideon Aberforth", genre: "History"},
        {title: "Elite Guardians", author: "Loki Odinson", genre: "SciFi"}

    ];

    return (
        <div className="ag-theme-alpine" style={{padding: 10, height: 400, width: 600}}>
            <AgGridReact
                rowData={rowData}>
                <AgGridColumn field="title"></AgGridColumn>
                <AgGridColumn field="author"></AgGridColumn>
                <AgGridColumn field="genre"></AgGridColumn>
            </AgGridReact>
        </div>
    );
};

export {SearchPage};
